import React, { Fragment } from "react";
import Sidebar from "../components/Sidebar";

const HomePage = () => {
  return (
    <Fragment>
      <main className="main">
        <div className="container gutter-top">
          <div className="row sticky-parent">
            <Sidebar/>
          </div>
        </div>
      </main>


    </Fragment>
  );
};

export default HomePage;
